package com.server.base.testCase;

import com.server.base.baseTest.BaseTest;
import com.server.base.repository.dto.CategoryDto;
import com.server.base.repository.dto.DealLogDto;
import lombok.*;
import org.junit.jupiter.api.BeforeEach;
import org.junit.jupiter.api.Test;

import java.time.LocalDate;
import java.util.Calendar;

public class DealLogTest extends BaseTest {
    @BeforeEach
    void settings(){
        super.prefix += "/dealLog";
    }

    @Test
    void test(){
        System.out.println(LocalDate.parse("2022-06-26").getDayOfMonth());
        System.out.println(LocalDate.parse("2022-06-26").getDayOfWeek());
        System.out.println(LocalDate.parse("2022-06-26").getDayOfWeek().getValue());
        Integer year = LocalDate.parse("2022-06-26").getYear();
        Integer month = LocalDate.parse("2022-06-26").getMonth().getValue();
        Integer day = LocalDate.parse("2022-06-26").getDayOfMonth();
        Calendar calendar = Calendar.getInstance();
        calendar.set(year, month, day);
        System.out.println(calendar);
        System.out.println(calendar.get(Calendar.WEEK_OF_MONTH));
    }

    @Test
    void saveDealLog(){
        String transport = "data:image/png;base64,";
        String food = "data:image/png;base64,";
        CategoryDto transportCategory = CategoryDto.builder().categoryNo(2L).cateName("교통비").isOutcome(true).cateIsBasic(true).cateFlag(true).cateImage(transport).build();
        CategoryDto foodCategory = CategoryDto.builder().cateName("외식비").categoryNo(4L).isOutcome(true).cateIsBasic(true).cateFlag(true).cateImage(food).build();

        for(int i =1; i<=30; i++){
            DealLogDto dealLogDto = DealLogDto.builder().dealDate(LocalDate.of(2022, 6, i)).dealContent("교통비!")
                    .dealPrice(1250).category(transportCategory).isOutcome(true).build();

            this.post("/save", dealLogDto);
        }
    }

    @Test
    void removeDealLog(){
        DealLogDtoB dealLogDto = DealLogDtoB.builder().dealLogNo(1L).build();
        this.delete("/remove",dealLogDto);
    }
}
@NoArgsConstructor
@AllArgsConstructor
@Builder
@Setter
@Getter
class DealLogDtoB{
    Long dealLogNo;
}
